// mode 选择模式, action1 表示具体选择的动作
typedef struct ReceiveData{
    unsigned char startflag;
    unsigned char mode;         // 选择的模式, 0表示没有选择, 1表示选择了动作矫正, 2表示 3表示选择了减脂
    unsigned char action1;      // 第一个动作的编号
} ReceiveData;

typedef struct SendData{
    unsigned char startflag;
    unsigned char score;            // 返回一个得分, 越准确得分越高, 在计数中，反馈有效动作的个数
} SendData;

ReceiveData * receiveData;
ReceiveData * uartReadData;
SendData * uartSendData;

unsigned char buffer[sizeof(ReceiveData)];
void read_uart_data(int uartFd, ReceiveData* data);

